import React from 'react';

const AboutPage = () => (
    <React.Fragment>
    <h1>Hello, welcome to Bruno's react blog!</h1>
    <p>This is a React built blog. It was very nice to build it!</p>
    <p>I love React.js!</p>
    </React.Fragment>
);

export default AboutPage;
